import{_ as i}from"./plugin-vue_export-helper.21dcd24c.js";import{o as a,c as p,e}from"./app.801c5d10.js";var l="/assets/text-field.4dac29c6.jpg",t="/assets/text-field-original.eb07fd81.jpg",r="/assets/text-field-align.94219eeb.jpg",s="/assets/text-field-align2.e3d4ec01.jpg",d="/assets/text-field-icon.f1822cb2.jpg",o="/assets/text-field-placeholder.e11052cb.jpg",c="/assets/text-field-md.0908660d.gif",n="/assets/text-field-placeholder-search.0486bff1.jpg",g="/assets/text-field-feedback.a089bb7d.jpg",_="/assets/text-field-feedback2.572184d7.jpg";const h={},f=e('<p>\u6587\u672C\u6846\u7684\u51FA\u73B0\u51E0\u4E4E\u53EF\u4EE5\u8FFD\u6EAF\u5230\u53EF\u89C6\u5316\u4EA4\u4E92\u8BDE\u751F\u7684\u6E90\u5934\uFF0C\u662F\u4E00\u4E2A\u518D\u7ECF\u5178\u4E0D\u8FC7\u7684\u300C\u9F3B\u7956\u300D\u63A7\u4EF6\u4E86\u3002\u6211\u4EEC\u6BCF\u5929\u90FD\u5728\u548C\u6587\u672C\u6846\u6253\u4EA4\u9053\uFF0C\u4E0D\u8BBA\u60A8\u662F\u4EA7\u54C1\u8BBE\u8BA1\u8005\u8FD8\u662F\u7528\u6237\u3002</p><h2 id="\u6587\u672C\u6846\u7684\u62C6\u89E3" tabindex="-1"><a class="header-anchor" href="#\u6587\u672C\u6846\u7684\u62C6\u89E3" aria-hidden="true">#</a> \u6587\u672C\u6846\u7684\u62C6\u89E3</h2><p>\u6587\u672C\u6846(Text Fields)\u6839\u636E Material Design \u6307\u5BFC\u89C4\u8303\uFF0C\u88AB\u62C6\u89E3\u4E3A\u4E03\u4E2A\u90E8\u5206\u3002\u5206\u522B\u662F:</p><p><img src="'+l+'" alt="\u6587\u672C\u6846\u7684\u62C6\u89E3" loading="lazy"></p><ul><li>\u5BB9\u5668(Container)</li><li>\u524D\u5BFC\u56FE\u6807(Leading icon)</li><li>\u6807\u7B7E\u6587\u672C(Label text)</li><li>\u8F93\u5165\u6587\u672C(Input text)</li><li>\u5C3E\u968F\u56FE\u6807(Trailing icon)</li><li>\u6FC0\u6D3B\u6307\u793A\u5668(Activation indicator)</li><li>\u5E2E\u52A9\u6587\u672C(Helper text)</li></ul><p>\u5F53\u7136\uFF0CMD \u4E3A\u6211\u4EEC\u5C55\u793A\u7684\u662F\u5DF2\u7ECF\u7ECF\u8FC7\u5176\u56E2\u961F\u957F\u671F\u6478\u7D22\u4E4B\u540E\uFF0C\u57FA\u4E8E\u5176\u5E73\u53F0\u89C4\u8303\u4E0B\u7684\u6807\u51C6\u6837\u5F0F\u3002\u60F3\u8981\u63A2\u7D22\u6587\u672C\u6846\u7684\u4EA4\u4E92\u6F14\u53D8\uFF0C\u6211\u4EEC\u8FD8\u662F\u8981\u56DE\u6EAF\u5230\u6587\u672C\u6846\u6700\u521D\u7684\u6A21\u6837\u3002</p><p><img src="'+t+'" alt="\u6587\u672C\u6846\u57FA\u7840\u6837\u5F0F" loading="lazy"></p><p>\u8FD9\u5C31\u662F\u4E00\u4E2A\u6587\u672C\u6846\u6700\u57FA\u7840\u7684\u6837\u5F0F\u4E86\uFF0C \u4E00\u4E2A\u6807\u7B7E\u6587\u672C+\u5BB9\u5668\uFF0C\u5DF2\u7ECF\u57FA\u672C\u53EF\u4EE5\u786E\u4FDD\u5411\u7528\u6237\u4F20\u9012\u6587\u672C\u6846\u6700\u76F4\u89C2\u7684\u4FE1\u606F\u3002</p><p>\u4F46\u5982\u4ECA\u7684\u6587\u672C\u6846\u5DF2\u7ECF\u6F14\u53D8\u51FA\u4E86\u5F62\u5F62\u8272\u8272\u7684\u6837\u5F0F\u548C\u4EA4\u4E92\u5F62\u5F0F\uFF0C\u7A76\u7ADF MD \u7684\u6587\u672C\u6846\u662F\u5982\u4F55\u6F14\u53D8\u5230\u4ECA\u5929\u8FD9\u756A\u6837\u5B50?</p><h2 id="\u57FA\u7840\u7684\u6587\u672C\u6846\u5E03\u5C40\u65B9\u5F0F" tabindex="-1"><a class="header-anchor" href="#\u57FA\u7840\u7684\u6587\u672C\u6846\u5E03\u5C40\u65B9\u5F0F" aria-hidden="true">#</a> \u57FA\u7840\u7684\u6587\u672C\u6846\u5E03\u5C40\u65B9\u5F0F</h2><p>\u6FC0\u52B1\u8BBE\u8BA1\u5E08\u4E0D\u505C\u63A2\u7D22\u6587\u672C\u6846\u65B0\u7684\u4EA4\u4E92\u5F62\u5F0F\u7684\u6839\u672C\u539F\u56E0\u4E4B\u4E00\uFF0C\u4E00\u5B9A\u5305\u542B\u603B\u8BA9\u4EBA\u5934\u75BC\u7684\u6392\u7248\u95EE\u9898\u3002\u5728\u89E3\u51B3\u4E86\u57FA\u672C\u89C6\u89C9\u95EE\u9898\u4E4B\u540E\uFF0C\u624D\u662F\u601D\u8003\u5982\u4F55\u8BBE\u8BA1\u6587\u672C\u6846\u6765 \u63D0\u5347\u7528\u6237\u7684\u586B\u5199\u548C\u4F7F\u7528\u6548\u7387\u3002</p><p>\u4F8B\u5982\u524D\u9762\u6211\u4EEC\u6240\u770B\u5230\u7684\u6700\u57FA\u7840\u7684\u6587\u672C\u6846\u6837\u5F0F\uFF0C\u5982\u679C\u7B80\u5355\u5730\u8FDB\u884C\u5355\u5217\u5E03\u5C40\uFF0C\u81EA\u7136\u800C\u7136\u4F1A\u51FA\u73B0\u8BA9\u4F17\u591A\u8BBE\u8BA1\u5E08\u7EA0\u7ED3\u7684\u4E00\u4E2A\u95EE\u9898: \u6807\u7B7E\u6587\u672C\u7A76\u7ADF\u5E94\u8BE5\u5982\u4F55\u5BF9\u9F50?</p><p><img src="'+r+'" alt="\u6587\u672C\u6846\u5BF9\u9F50" loading="lazy"></p><p>\u5982\u679C\u6807\u7B7E\u6587\u672C\u91C7\u7528\u53F3\u5BF9\u9F50\uFF0C\u6807\u7B7E\u6587\u672C\u7684\u957F\u77ED\u95EE\u9898\u5BB9\u6613\u5BFC\u81F4\u5DE6\u4FA7\u7684\u89C6\u89C9\u9690\u5F62\u8FB9\u754C\u9519\u4E71\uFF0C\u7528\u6237\u7684\u89C4\u5F8B\u773C\u52A8\u5BB9\u6613\u88AB\u6253\u4E71\uFF1B</p><p>\u5982\u679C\u6807\u7B7E\u6587\u672C\u91C7\u7528\u5DE6\u5BF9\u9F50\uFF0C\u6587\u672C\u7684\u957F\u77ED\u95EE\u9898\u53C8\u4F1A\u5BFC\u81F4\u90E8\u5206\u8F83\u77ED\u6807\u7B7E\u6587\u672C\u4E0E\u5BB9\u5668\u95F4\u8DDD\u589E\u5927\uFF0C\u8BA9\u7528\u6237\u4ECE\u5DE6\u81F3\u53F3\u6D4F\u89C8\u7684\u6548\u7387\u964D\u4F4E\uFF0C\u5E76\u4E14\u770B\u8D77\u6765\u4E0D\u591F\u534F\u8C03\u3002</p><p>\u4E8E\u662F\u4E4E\u6587\u672C\u6846\u7684\u5E03\u5C40\u65B9\u5F0F\u6709\u4E86\u8FDB\u4E00\u6B65\u7684\u6F14\u53D8: \u6807\u7B7E\u6587\u672C\u4E0E\u5BB9\u5668\u9876\u7AEF\u5BF9\u9F50\u3002</p><p><img src="'+s+'" alt="\u6587\u672C\u6846\u5BF9\u9F50" loading="lazy"></p><p>\u9876\u7AEF\u5BF9\u9F50\u7684\u65B9\u5F0F\u4F7F\u5F97\u7528\u6237\u773C\u52A8\u53D8\u5F97\u5341\u5206\u89C4\u5F8B\uFF0C\u7AD6\u76F4\u5411\u4E0B\u6D4F\u89C8\u53EF\u4EE5\u4FBF\u6377\u5730\u7406\u89E3\u6807\u7B7E\u6587\u672C\u5E76\u8FDB\u884C\u586B\u5199\uFF0C\u6587\u672C\u7684\u957F\u77ED\u95EE\u9898\u4E0D\u518D\u6210\u4E3A\u5E72\u6270\u8BBE\u8BA1\u5E08\u8FDB\u884C\u6392\u7248\u7684\u4E00\u4E2A\u7EA0\u7ED3\u70B9\u3002</p><p>\u4F46\u7EB5\u5411\u5E03\u5C40\u7684\u7684\u65B9\u5F0F\u53EA\u662F\u628A\u95EE\u9898\u8FC1\u79FB\u5230\u4E86\u53E6\u4E00\u4E2A\u7EF4\u5EA6\uFF0C\u90A3\u5C31\u662F\u5728\u8868\u5355\u6570\u636E\u91CF\u8FC7\u591A\u65F6\uFF0C\u7EB5\u5411\u5E03\u5C40\u4F1A\u4F7F\u5F97\u7EB5\u5411\u7A7A\u95F4\u8017\u635F\u589E\u52A0\uFF0C\u7528\u6237\u9700\u8981\u4E0D\u505C\u5730\u6ED1\u52A8\u9875\u9762\u624D\u80FD\u5B9E\u73B0\u8868\u5355\u7684\u5B8C\u6574\u586B\u5199\u3002</p><p>\u6240\u4EE5\uFF0C\u6587\u672C\u6846\u7684\u5E03\u5C40\u9700\u8981\u591A\u65B9\u4F4D\u8BC4\u4F30\u6807\u7B7E\u6587\u672C\u957F\u5EA6\u3001\u8868\u5355\u6570\u636E\u91CF\u7B49\u95EE\u9898\uFF0C\u624D\u80FD\u5BF9\u5177\u4F53\u573A\u666F\u8FDB\u884C\u6709\u6548\u8BBE\u8BA1\u3002</p><h2 id="\u6587\u672C\u6846\u7684\u6539\u826F" tabindex="-1"><a class="header-anchor" href="#\u6587\u672C\u6846\u7684\u6539\u826F" aria-hidden="true">#</a> \u6587\u672C\u6846\u7684\u6539\u826F</h2><p>\u5F53\u6587\u672C\u6846\u6A2A\u5411\u5E03\u5C40\u6216\u662F\u7EB5\u5411\u5E03\u5C40\u90FD\u5F88\u96BE\u89E3\u51B3\u5177\u4F53\u573A\u666F\u95EE\u9898\u7684\u65F6\u5019\uFF0C\u66F4\u65B0\u9896\u7684\u6587\u672C\u6846\u4EA4\u4E92\u5F62\u5F0F\u5C31\u51FA\u73B0\u4E86\u3002</p><p>\u6700\u521D\u7684\u6F14\u53D8\u5F62\u5F0F\u662F\u4F17\u591A\u7684\u5E94\u7528\u5F00\u59CB\u91C7\u7528\u524D\u5BFC\u56FE\u6807\u6765\u66FF\u4EE3\u6807\u7B7E\u6587\u672C\uFF0C\u4F7F\u7528\u56FE\u6807\u53EF\u4EE5\u6709\u6548\u5730\u89E3\u51B3\u6807\u7B7E\u6587\u672C\u5BFC\u81F4\u7684\u6392\u7248\u9519\u843D\u95EE\u9898\u3002</p><p><img src="'+d+'" alt="\u56FE\u6807\u63D0\u793A" loading="lazy"></p><p>\u8FD9\u79CD\u65B9\u6848\u5728\u8F7B\u91CF\u8868\u5355\u4E2D\u8F83\u4E3A\u5E38\u89C1\uFF0C\u4E00\u822C\u90FD\u662F\u5728\u8868\u5355\u5185\u5BB9\u5C11\u3001\u7528\u6237\u5BF9\u4E8E\u573A\u666F\u7684\u719F\u6089\u5EA6\u8F83\u9AD8\u7684\u60C5\u666F\u5F53\u4E2D(\u4F8B\u5982\u767B\u5F55\u573A\u666F)\u3002</p><p>\u56E0\u4E3A\u6BCF\u4E2A\u7528\u6237\u5BF9\u4E8E\u56FE\u6807\u7684\u8BA4\u77E5\u6027\u5B58\u5728\u5DEE\u5F02\uFF0C\u5728\u751F\u758F\u573A\u666F\u6216\u8868\u5355\u5185\u5BB9\u8FC7\u591A\u7684\u60C5\u51B5\u4E0B\uFF0C\u56FE\u6807\u5BB9\u6613\u5BFC\u81F4\u7528\u6237\u5BF9\u6587\u672C\u6846\u4FE1\u606F\u4EA7\u751F\u66F4\u591A\u7684\u8BA4\u77E5\u6210\u672C\u3002\u6240\u4EE5\u7528\u56FE\u6807\u6765\u4EE3\u66FF\u6807\u7B7E\u6587\u672C\u7684\u666E\u9002\u6027\u5176\u5B9E\u5E76\u4E0D\u9AD8\u3002</p><p>\u4E8E\u662F\u540E\u6765 iOS \u4EBA\u673A\u4EA4\u4E92\u89C4\u8303 \u548C MD \u89C4\u8303 \u90FD\u7ED9\u8BBE\u8BA1\u5E08\u63D0\u51FA\u4E86\u4E00\u6761\u6307\u5BFC\u5EFA\u8BAE: \u5F53\u5360\u4F4D\u7B26\u5B57\u6BB5\u4E2D\u4E0D\u5305\u542B\u5FC5\u8981\u5185\u5BB9\u65F6\uFF0C\u53EF\u4EE5\u5408\u7406\u5730\u4F7F\u7528\u5360\u4F4D\u7B26\u6765\u627F\u8F7D\u6807\u7B7E\u6587\u672C\u3002</p><p>\u4F8B\u5982 iOS \u901A\u8BAF\u5F55\u65B0\u589E\u8054\u7CFB\u4EBA\uFF0C\u5C31\u91C7\u7528\u4E86\u5360\u4F4D\u7B26\u627F\u8F7D\u6807\u7B7E\u6587\u672C\u7684\u65B9\u5F0F\u3002</p><p><img src="'+o+'" alt="iOS \u5360\u4F4D\u7B26\u63D0\u793A" loading="lazy"></p><p>\u4F46\u8FD9\u79CD\u5F62\u5F0F\u540C\u6837\u4E5F\u5B58\u5728\u4E00\u4E2A\u5F0A\u7AEF: \u7528\u6237\u4E00\u65E6\u8F93\u5165\u5185\u5BB9\u4E4B\u540E\uFF0C\u5360\u4F4D\u7B26\u5C31\u88AB\u5185\u5BB9\u6587\u672C\u586B\u5145\u8986\u76D6\u4E86\uFF0C\u6709\u65F6\u7528\u6237\u4F1A\u5FD8\u8BB0\u6240\u586B\u5199\u7684\u4FE1\u606F\u662F\u5173\u4E8E\u4EC0\u4E48\u5185\u5BB9\uFF0C\u5FC5\u987B\u8981\u6E05\u7A7A\u6587\u672C\u8FDB\u884C\u91CD\u65B0\u786E\u8BA4\u3002\u5BF9\u4E8E\u8868\u5355\u5185\u5BB9\u7E41\u591A\u6216\u91CD\u8981\u5185\u5BB9\u9700\u8981\u8C28\u614E\u586B\u5199\u7684\u573A\u666F\uFF0C\u8FD9\u6837\u7684\u4EA4\u4E92\u5176\u5B9E\u8FD8\u662F\u6709\u4E00\u4E9B\u4E0D\u59A5\u3002</p><p>\u4E8E\u662F\u4E4E\uFF0C\u7C7B\u4F3C MD \u7684\u6307\u5BFC\u89C4\u8303\u4E0B\u8FD9\u6837\u666E\u9002\u6027\u8F83\u9AD8\u7684\u6587\u672C\u6846\u5F62\u5F0F\u5C31\u8BDE\u751F\u4E86\u3002\u91C7\u7528\u5360\u4F4D\u7B26\u627F\u8F7D\u6807\u7B7E\u6587\u672C\uFF0C\u5E76\u4E14\u5728\u7528\u6237\u586B\u5199\u4FE1\u606F\u65F6\uFF0C\u6807\u7B7E\u6587\u672C\u59CB\u7EC8\u53EF\u89C1\uFF0C\u7531\u5360\u4F4D\u7B26\u8F6C\u79FB\u5230\u6587\u672C\u6846\u9876\u90E8\u3002</p><p><img src="'+c+'" alt="MD \u6807\u7B7E" loading="lazy"></p><p>\u8FD9\u4E00\u6587\u672C\u6846\u4EA4\u4E92\u5F62\u5F0F\u7684\u8BDE\u751F\uFF0C\u4E0D\u8BBA\u662F\u5BF9\u4E8E\u6392\u7248\u7A7A\u95F4\u7684\u8282\u7701\u3001\u9075\u5FAA\u7528\u6237\u773C\u52A8\u4E60\u60EF\u3001\u5FAE\u52A8\u6548\u63D0\u5347\u6587\u672C\u6846\u8DA3\u5473\u6027\u7B49\u65B9\u9762\uFF0C\u90FD\u5F97\u5230\u4E86\u4E00\u5B9A\u63D0\u5347\u3002\u5E76\u4E14\u8BB8\u591A\u5E94\u7528\u5F00\u59CB\u8FDB\u884C\u501F\u9274\u6548\u4EFF\u3002</p><p>\u5176\u5B9E\u50CF\u4EE5\u4E0A\u8FD9\u79CD\u5DE7\u7528\u5360\u4F4D\u7B26\u7684\u573A\u666F\u5DF2\u7ECF\u8D8A\u6765\u8D8A\u5E38\u89C1\u4E86\uFF0C\u5360\u4F4D\u7B26\u5DF2\u7ECF\u4E0D\u518D\u4EC5\u4EC5\u7528\u6765\u627F\u8F7D\u65E0\u7528\u4FE1\u606F\u6216\u63D0\u793A\u6027\u4FE1\u606F\uFF0C\u4E5F\u53EF\u4EE5\u7528\u4E8E\u627F\u8F7D \u9ED8\u8BA4\u503C\uFF0C\u5E2E\u52A9\u7528\u6237\u81EA\u52A8\u586B\u5145\uFF0C \u63D0\u9AD8\u7528\u6237\u586B\u5199\u4FE1\u606F\u7684\u6548\u7387(\u4F8B\u5982\u624B\u6E38\u5F53\u4E2D\uFF0C\u521B\u5EFA\u8D26\u53F7\u65F6\u7CFB\u7EDF\u5E2E\u73A9\u5BB6\u9ED8\u8BA4\u586B\u5145\u4E00\u4E2A\u53EF\u7528\u6635\u79F0)\u3002</p><p>\u4F46\u586B\u5145\u9ED8\u8BA4\u503C\u7684\u624B\u6CD5\u4E5F\u4E0D\u4EC5\u4EC5\u5C40\u9650\u4E8E\u63D0\u5347\u7528\u6237\u4F53\u9A8C\u548C\u586B\u5199\u6548\u7387\uFF0C\u751A\u81F3\u4E5F\u88AB\u8FD0\u7528\u5230\u4E86\u4E00\u4E9B\u5546\u4E1A\u573A\u666F\u4E2D\u3002</p><p>\u4F8B\u5982\u6DD8\u5B9D\u3001\u4EAC\u4E1C\u7B49\u7535\u5546\u5E73\u53F0\uFF0C\u5C06\u5546\u54C1\u540D\u79F0\u4F5C\u4E3A\u5360\u4F4D\u7B26\u586B\u5145\u5728\u641C\u7D22\u680F\u4E2D\uFF0C\u4E00\u65B9\u9762\u7ED9\u6240\u63A8\u8350\u5546\u54C1\u589E\u52A0\u4E86\u66DD\u5149\uFF1B\u53E6\u4E00\u65B9\u9762\uFF0C\u5728\u7528\u6237\u76F4\u63A5\u70B9\u51FB\u641C\u7D22\u65F6\uFF0C\u5C06\u4F1A\u4EE5\u5F53\u524D\u5360\u4F4D\u7B26\u5185\u5BB9\u8FDB\u884C\u641C\u7D22\uFF0C\u8FBE\u5230\u4E3A\u6240\u63A8\u8350\u5546\u54C1\u5F15\u6D41\u7684\u6548\u679C\u3002</p><p><img src="'+n+'" alt="\u5F15\u6D41" loading="lazy"></p><h2 id="\u5408\u7406\u7684\u53CD\u9988" tabindex="-1"><a class="header-anchor" href="#\u5408\u7406\u7684\u53CD\u9988" aria-hidden="true">#</a> \u5408\u7406\u7684\u53CD\u9988</h2><p>\u5408\u7406\u7684\u53CD\u9988\u673A\u5236\u5BF9\u4E8E\u63D0\u5347\u7528\u6237\u586B\u5199\u6587\u672C\u6846\u6548\u7387\u4E5F\u8D77\u7740\u91CD\u8981\u7684\u4F5C\u7528\uFF0CMD \u89C4\u8303\u4E2D\u7684\u5E2E\u52A9\u6587\u672C\u4E0D\u4EC5\u4EC5\u662F\u544A\u8BC9\u8BBE\u8BA1\u8005\u53EF\u4EE5\u7528\u4E8E\u6307\u5BFC\u7528\u6237\u8BE5\u5982\u4F55\u6B63\u786E\u586B\u5199\u6587\u672C\u6846\u4FE1\u606F\uFF0C\u4E5F\u4E3A\u53CD\u9988\u63D0\u793A\u63D0\u4F9B\u4E86\u5C55\u793A\u7A7A\u95F4\u3002</p><p>MD \u7684\u53CD\u9988\u72B6\u6001\u53EF\u4EE5\u5F52\u7EB3\u4E3A\u4EE5\u4E0B\u51E0\u79CD:</p><p><img src="'+g+'" alt="\u53CD\u9988" loading="lazy"></p><p>\u5728\u8FD9\u91CC\u6211\u5927\u6982\u603B\u7ED3\u4E86\u4E00\u4E0B\u6587\u672C\u6846\u7684\u8D1F\u53CD\u9988\u63D0\u793A\u4FE1\u606F\uFF0C\u5E0C\u671B\u5728\u60A8\u8BBE\u8BA1\u8868\u5355\u7684\u65F6\u5019\uFF0C\u80FD\u591F\u5E2E\u52A9\u5230\u60A8\u5BF9\u8D1F\u53CD\u9988\u63D0\u793A\u72B6\u6001\u8FDB\u884C\u8D70\u67E5(\u53EF\u80FD\u4E0D\u5168\uFF0C\u6B22\u8FCE\u8865\u5145):</p><ul><li>\u5185\u5BB9\u662F\u5426\u4E3A\u7A7A(\u4F8B: \u5FC5\u586B\u9879\u4E0D\u80FD\u4E3A\u7A7A)</li><li>\u4E8C\u6B21\u786E\u8BA4\u5185\u5BB9\u662F\u5426\u4E00\u81F4(\u4F8B: \u786E\u8BA4\u5BC6\u7801\u4E0E\u9996\u6B21\u8F93\u5165\u4E0D\u4E00\u81F4)</li><li>\u5185\u5BB9\u662F\u5426\u5408\u89C4 (\u4F8B: \u6635\u79F0\u4E2D\u5305\u542B\u4E0D\u6587\u660E\u8BCD\u8BED)</li><li>\u5185\u5BB9\u683C\u5F0F\u662F\u5426\u5408\u89C4(\u4F8B: \u6635\u79F0\u4E2D\u4E0D\u80FD\u5305\u542B\u7279\u6B8A\u5B57\u7B26)</li><li>\u5185\u5BB9\u957F\u5EA6\u662F\u5426\u5408\u89C4(\u4F8B: \u624B\u673A\u53F7\u8F93\u5165\u4E0D\u8DB3 11 \u4F4D)</li><li>\u5185\u5BB9\u7684\u662F\u5426\u7B26\u5408\u552F\u4E00\u6027(\u4F8B: \u9A8C\u8BC1\u7801\u8F93\u5165\u9519\u8BEF)</li></ul><p>\u53CA\u65F6\u7ED9\u4E88\u7528\u6237\u8D1F\u53CD\u9988\uFF0C\u53EF\u4EE5\u8BA9\u7528\u6237\u6E05\u6670\u5730\u6392\u67E5\u6240\u53D1\u751F\u7684\u9519\u8BEF\u3002\u4F46\u4EA4\u4E92\u8BBE\u8BA1\u8BB2\u7A76\u300C\u4EE5\u4EBA\u4E3A\u672C\u300D\uFF0C\u5728\u67D0\u4E9B\u573A\u666F\u4E2D\uFF0C\u5F53\u7528\u6237\u6240\u586B\u5199\u7684\u4FE1\u606F\u662F\u5408\u7406\u7684\uFF0C\u53CA\u65F6\u5730\u5C55\u793A \u6B63\u5411\u53CD\u9988\u4E5F\u662F\u6709\u5FC5\u8981\u7684\u3002</p><p>\u4F8B\u5982\uFF0C\u90E8\u5206\u5E94\u7528\u5728\u7528\u6237\u521B\u5EFA\u8D26\u53F7\u7684\u573A\u666F\u4E2D\uFF0C\u5F53\u7528\u6237\u8F93\u5165\u8D26\u53F7\u4FE1\u606F\u540E\uFF0C\u7CFB\u7EDF\u5C06\u7ACB\u523B\u68C0\u7D22\u7528\u6237\u7684\u8D26\u53F7\u662F\u5426\u5DF2\u5B58\u5728\u5728\u5F53\u524D\u6570\u636E\u5E93\u4E2D\uFF0C\u907F\u514D\u7528\u6237\u5FD8\u8BB0\u5DF2\u521B\u5EFA\u8FC7\u8BE5\u8D26\u53F7\u800C\u8FDB\u884C\u91CD\u590D\u521B\u5EFA\u7684\u5F92\u52B3\u6B65\u9AA4\u3002</p><p><img src="'+_+'" alt="\u53CD\u9988" loading="lazy"></p><p>\u6240\u4EE5\u4E0D\u8981\u72ED\u9698\u5730\u8BA4\u4E3A MD \u6240\u7ED9\u5230\u7684\u5E2E\u52A9\u6587\u672C\u53EA\u80FD\u7528\u4E8E\u300C\u6279\u8BC4\u300D\u7528\u6237(\u8D1F\u53CD\u9988)\uFF0C \u5F53\u7528\u6237\u505A\u4E86\u6B63\u786E\u7684\u4E8B\u65F6\uFF0C\u4E5F\u5E94\u8BE5\u9002\u5F53\u5730\u6FC0\u52B1\u7528\u6237\uFF0C\u8FD9\u4E5F\u6B63\u7B26\u5408\u4E86\u5C3C\u5C14\u68EE\u53EF\u89C1\u6027\u539F\u5219\u3002</p>',47),m=[f];function x(b,u){return a(),p("div",null,m)}var z=i(h,[["render",x],["__file","text-field.html.vue"]]);export{z as default};
